      <div style={{height:'10px'}}></div>
      <div className="card1">
        <p>Notification</p> 
      </div>
      <div style={{height:'10px'}}></div>
      <div className="card1">
        <p>Add Projects</p> 
      </div>

    </div>
          </div>
          <div className="right-side">
            {tab ===  Add ? (
            <div>
            <div className="form">
              <Form />
            </div>
            <div className="forms2">
              <Form2 />
            </div>
            </div>
            ) :("")}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Main;
